            margin-bottom: 10px;
            text-shadow: 0 0 10px rgba(255, 255, 255, 0.8);
        }

        .jackpot-container .jackpot-amount {
            font-size: 24px;
            font-weight: bold;
            color: white;
            font-family: 'Arial', sans-serif;
            background: url('https://cdn.zabbet.com/7CAK/highlight/1725948738165-4cb4f1ec-44ed-4b21-99ed-398fbb6d7b25.gif') no-repeat center center;
            background-size: cover;
            padding: 40px 80px;
            display: inline-block;
            position: relative;
            overflow: hidden;
            border-radius: 15px;
            
        }

        .jackpot-container .jackpot-amount::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.1);
            z-index: 0;
        }

        .jackpot-container .jackpot-number {
            position: relative;
            z-index: 1;
            display: block;
        }

        .jackpot-container .epic-text {
            font-size: 14px;
            color: white;
            font-style: italic;
            margin-top: 10px;
            text-shadow: 0 0 5px rgba(255, 255, 255, 0.5);
        }

        @keyframes popup {
            0% { transform: scale(1); }
            50% { transform: scale(1.2); }
            100% { transform: scale(1); }
        }

        .jackpot-container .popup-animation {
            animation: popup 0.5s ease-in-out;
        }

