            .jackpot-container .jackpot-title {
                font-size: 18px;
            }

            .jackpot-container .jackpot-amount {
                font-size: 18px;
                padding: 25px 70px;
            }

            .jackpot-container .epic-text {
                font-size: 10px;
            }
        }
    </style>


    
    <div class="main-container">
        
        <div class="jackpot-container">
            <div class="jackpot-amount">
                <span id="jackpot-number" class="jackpot-number">59,202,520</span>
            </div>
        </div>
    </div>

    <script>
        function formatNumber(num) {
            return num.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
        }

        const initialNumber = 59202520;
        const maxIncrement = 9999; // ค่าสูงสุดของการเพิ่มในแต่ละครั้ง
        const intervalTime = 3000;
        const numberDisplay = document.getElementById("jackpot-number");
        const jackpotContainer = document.querySelector(".jackpot-amount");

        let currentNumber = parseInt(localStorage.getItem("jackpotNumber")) || initialNumber;
        let lastUpdateTime = parseInt(localStorage.getItem("lastUpdateTime")) || Date.now();

        const currentTime = Date.now();
        const timeDiff = currentTime - lastUpdateTime;
        const incrementsMissed = Math.floor(timeDiff / intervalTime);

        // สุ่มค่า increment สำหรับการคำนวณที่พลาดไป (ถ้ามี)
        for (let i = 0; i < incrementsMissed; i++) {
            const randomIncrement = Math.floor(Math.random() * (maxIncrement + 1)); // สุ่มตั้งแต่ 0 ถึง 9999
            currentNumber += randomIncrement;
        }

        numberDisplay.textContent = formatNumber(currentNumber);

        function getRandomNumber(baseNumber) {
            const variation = Math.floor(Math.random() * 100000) - 50000;
            return Math.max(0, baseNumber + variation);
        }

        function animateNumberChange(targetNumber) {
            let randomCount = 0;
            const randomInterval = 100;
            const randomDuration = 800;

            const randomAnimation = setInterval(() => {
                const randomNum = getRandomNumber(targetNumber);
                numberDisplay.textContent = formatNumber(randomNum);
                
                numberDisplay.classList.remove("popup-animation");
                void numberDisplay.offsetWidth;
                numberDisplay.classList.add("popup-animation");

                randomCount += randomInterval;
                if (randomCount >= randomDuration) {
                    clearInterval(randomAnimation);
                    numberDisplay.textContent = formatNumber(targetNumber);
                    numberDisplay.classList.remove("popup-animation");
                    void numberDisplay.offsetWidth;
                    numberDisplay.classList.add("popup-animation");
                }
            }, randomInterval);

            const currentBackground = jackpotContainer.style.background;
            jackpotContainer.style.background = "none";
            setTimeout(() => {
                jackpotContainer.style.background = currentBackground;
            }, 10);
        }

        function incrementNumber() {
            // สุ่มค่า increment ตั้งแต่ 0 ถึง 9999
            const randomIncrement = Math.floor(Math.random() * (maxIncrement + 1));
            currentNumber += randomIncrement;
            animateNumberChange(currentNumber);

            localStorage.setItem("jackpotNumber", currentNumber);
            localStorage.setItem("lastUpdateTime", Date.now());
        }

        setInterval(incrementNumber, intervalTime);
    </script>

    
    
